import { Box, Toolbar, Typography } from "@mui/material";

const Footer = () => {
  return (
    <Box className="bg-[#304FA1] p-0">
      <Toolbar sx={{paddingLeft: 0}}>
        <div style={{flex: 6, border: '1px solid white'}}>hammad</div>
        <div style={{flex: 4, border: '1px solid white'}}>hammad</div>
        <div style={{flex: 5, border: '1px solid white'}}>hammad</div>
      </Toolbar>
      <Toolbar sx={{ backgroundColor: '#0002', height: '100px', paddingX: '50px'}}>
        <Typography variant="" sx={{fontWeight: 600, color: '#fff'}}>&copy; SolXraf. All Rights Reserved</Typography>
      </Toolbar>
    </Box>
  );
};

export default Footer;
